description:
O app Gmail oficial oferece o melhor do Gmail para iPhone ou iPad, com notificações em tempo real, compatibilidade com várias contas e pesquisa de todos os seus e-mails.

Com o app Gmail, você pode:
- cancelar o envio para evitar enganos constrangedores;
- alternar entre várias contas;
- receber notificações sobre novos e-mails rapidamente, com a Central de Notificações, selos e opções da tela de bloqueio;
- pesquisar todos os seus e-mails rapidamente, com resultados instantâneos, previsões conforme você digita e sugestões de ortografia;
- deslizar para arquivar/excluir mensagens, limpando com rapidez sua Caixa de entrada;
- ler seus e-mails como conversas;
- preencher automaticamente nomes de contatos conforme você digita a partir dos seus contatos do Google ou do seu smartphone;
- responder a convites do Google Agenda diretamente do app;
- organizar seu e-mail usando arquivamento, marcadores, estrelas, exclusão e denúncia de spam;
- enviar e receber anexos;
- ver fotos do perfil como parte da conversa.

Quer ganhar muito cashback em seus pagamentos e ainda simplificar a sua vida? Então baixe agora mesmo o PicPay. 

Com o PicPay você pode:
- Receber e enviar dinheiro para outras pessoas
- Pagar contas e parcelar boletos;
- Ganhar cashback em diversas compras.
- Recarregar o celular;
- Recarregar o seu cartão de transporte pelo app, evitando filas e agilizando o seu dia a dia (Válido para São Paulo, Ribeirão Preto, Diadema, Taubaté, Sorocaba, Rio de Janeiro e Pelotas);
- Comprar créditos para games online;
- Comprar crédito online para os seus serviços digitais favoritos com Uber e Ifood;
- Comprar créditos da sua operadora de TV por assinatura ou serviço de streaming;
- Fazer pagamentos nos milhares de estabelecimentos que usam o PicPay Empresas ou via QR Code nas maquininhas Cielo, Rede e Getnet;
- Fazer e receber pagamentos online, transferências e Pix;
- Pagar para o seu amigo que (ainda) não tem PicPay via Pix - e receber via Pix caso queira.
- E o seu dinheiro ainda rende mais que a poupança!

E além de todas essas simplicidades para a sua vida tem sempre uma promoção nova para você aproveitar e ganhar cashback. Pode ser no mercado, pagando amigos, na farmácia: basta ficar ligado nas mensagens que nós mandamos para saber como ganhar cashback.

Com o PicPay, pagar e receber dinheiro é mais fácil do que enviar mensagens e você ainda ganha muito cashback!

PicPay – todo mundo usa. Todo lugar aceita.

