- Cremes e hidratantes para o corpo
- Skincare das melhores marcas nacionais e internacionais para tratamento facial
- Carolina Herrera, MAC, L’occitane, Keune e as marcas mais desejadas
Em Casa, aproveite para comprar itens de decoração para transformar seu lar:
- Tapetes, cortinas, almofadas e quadros para a sala
- Roupa de cama, edredom e travesseiro para o quarto
- Panelas, jarras, copos e taças para a cozinha

