O Outlook permite que você reúna todas as contas de email e calendários convenientemente em um único lugar. Seja mantendo o controle sobre sua Caixa de Entrada ou programando o próximo grande evento, facilitamos o uso para que você se torne uma pessoa cada vez mais conectada e organizada.

Confira o que você vai adorar sobre o Outlook para iOS:

– Concentre-se nas coisas certas com a nossa Caixa de Entrada inteligente: ajudamos você a separar as mensagens que precisam ser respondidas imediatamente das demais;

– Deslize para agendar, excluir e arquivar rapidamente mensagens;

– Compartilhe sua disponibilidade com apenas um toque e localize facilmente horários para se encontrar com outras pessoas;

– Encontre tudo o que está procurando com nossa nova experiência de pesquisa, incluindo arquivos, contatos e suas próximas viagens;

– Exiba e anexe qualquer arquivo do seu email, OneDrive, Dropbox e muito mais, sem precisar baixá-los no seu telefone;

– Exiba todos os aplicativos que você adora no Outlook, incluindo o Facebook, Evernote, Trello e muito mais;

– Abra o Word, Excel ou outros anexos de documento do Office para editá-los diretamente no aplicativo correspondente e anexá-los novamente a um email.

--

O Outlook para iOS funciona com o Microsoft Exchange, Office 365, Outlook.com (incluindo Hotmail e MSN), Gmail, Yahoo Mail e iCloud.

--

Para realizar uma compra no aplicativo de uma assinatura do Office 365 Home ou Personal, abra o aplicativo, vá até Configurações e toque em Atualizar, ao lado da sua conta do Hotmail.com ou do Outlook.com. Os preços das assinaturas começam em US$ 6,99 por mês nos Estados Unidos e podem variar por região. Com uma assinatura do Office 365, você tem 1 TB de armazenamento para cada usuário, acesso a todos os recursos dos aplicativos Word, Excel e PowerPoint nos dispositivos iPad, iPhone e iPod Touch, além de poder instalar os aplicativos Word, Excel, PowerPoint, Outlook e OneNote em PCs ou Macs.

As assinaturas do Office 365 compradas no aplicativo serão cobradas na conta do iTunes e renovadas automaticamente dentro de 24 horas antes do final do período de assinatura atual, a menos que a renovação automática tenha sido desabilitada. Para gerenciar as assinaturas ou desabilitar a renovação automática, acesse as configurações da conta no iTunes após a compra. Não é possível cancelar a assinatura durante o período da assinatura ativa. A parte não usada de um período de avaliação gratuita, caso tenha sido oferecido, será perdida quando o usuário comprar uma assinatura para aquela publicação, onde aplicável.

Privacidade e cookies: https://go.microsoft.com/fwlink/?LinkId=521839 
Termos de uso: http://go.microsoft.com/fwlink/?LinkID=530144

A Lensa é uma nova forma para tirar as suas selfies para que fiquem melhores que aquilo que alguma vez imaginou. Esqueça-se dos filtros convencionais e das ferramentas de edição de fotografias. Nós trazemos até si o mais simples, a app móvel mais prática até à data para retocar as suas selfies de imediato. Por isso, se existe algo que pensa deva ser corrigido na sua selfie, tem agora esta app fantástica e simples para o(a) ajudar.



RETOQUE A PELE DO SEU ROSTO



. Livre-se das borbulhas, rugas ou outros problemas no seu rosto;

. Faça com que a sua pele pareça suave e perfeita;

. Dê destaque ao seu rosto para que seja o centro da sua foto;

. Desfoque o fundo.



FAÇA COM QUE OS SEUS OLHOS FIQUEM IMPECÁVEIS



. Livre-se dos papos dos olhos apenas com um deslize;

. Dê destaque aos seus olhos juntando-lhes um contraste;

. Dê mais textura às suas sobrancelhas ao mover o cursor para o ponto necessário.



DESTAQUE-SE A SI PRÓPRIO (A) 



. Junte profundidade à sua selfie através da correção da lente;

Dê mais vida aos seus lábios e faça com que fiquem mais brilhantes e preenchidos;

. Ajuste a luz perfeita para o disparo da sua selfie.



AJUSTE O FUNDO



. Deslize na nitidez e profundidade do fundo;

. Faça com que se enquadre perfeitamente no seu retrato;

. Junte dinâmicas à sua selfie ao definir o fundo em movimento apenas com um deslize do cursor;

. Junte o efeito lente Petzval para ter a certeza que é a estrela da sua própria foto.



BENEFÍCIOS EXTRA



. Utilize o ajuste automático para deixar a app fazer tudo por si, se não tiver tempo;

. Aumente ou diminua a exposição de elementos selecionados para ajustar a sua função na foto;

. Faça com que a sua foto seja alegre, personalizada, triste, ou junte outra sensação ajustando a intensidade da cor; 

. Melhore a saturação para dar ênfase ao que precisar;

. Diferencie a foto ao alterar a sua nitidez;

. Faça com que a sua selfie fique com ar de sonhadora ao juntar-lhe o efeito de desvanecimento;

. Altere a temperatura da imagem para evidenciar o seu ânimo; 

. Junte tonalidades para que pareça aquilo que pretende. 

Os utilizadores de dispositivos iPhone Xr, iPhone Xs e iPhone Xs max podem gravar vídeos com a função de retoque facial.

Lensa oferece Assinaturas Premium:
- Anual por R$ 112,90/ano
- Mensal por R$ 18,90/mês

A Lensa disponibiliza Subscrições Premium. A compra será debitada na sua conta do iTunes. Será debitada uma conta para a renovação no período de 24 horas antes do final do período em curso, e identificar o custo da renovação. Faça a gestão da sua subscrição nas Definições de Utilizador no iTunes depois da compra. Cancele a renovação automática da subscrição a partir do iTunes a qualquer momento. Qualquer parte do período de demonstração gratuita que não tenha sido utilizada, caso seja oferecida, será perdida quando o utilizador comprar uma subscrição dessa publicação, quando aplicável.



Política de Privacidade http://lensa-ai.com/privacy.html

Termos de Utilização http://lensa-ai.com/terms.html

O aplicativo Meu INSS permite que você:

- peça um benefício ou serviço e acompanhe o andamento do pedido;
- solicite aposentadoria;
- calcule quanto tempo falta para aposentar;
- tire extratos como imposto de renda, pagamento de benefícios, contribuição no CNIS (Cadastro Nacional de Informações Sociais), empréstimos consignados;
- solicite declaração de recebimento de benefício do INSS;
- agende perícia médica;
- atualize seus dados de cadastro;
- solicite outros serviços.

Você também poderá encontrar a agência do INSS mais perto de você pelo aplicativo.

Para fazer seu cadastro no Meu INSS, você precisará de: CPF, nome completo, data de nascimento, nome da mãe e estado em que nasceu. Você terá também que responder algumas perguntas sobre sua vida profissional. As perguntas servem para conferir sua identidade.

Se tiver dúvidas, ligue para 135 (Central de Atendimento do INSS).

Fonte das informações sobre os serviços disponíveis no Meu INSS: https://www.inss.gov.br/servicos-do-inss/meu-inss/

